    content = charToRaw("<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<eml:eml xmlns:eml=\"https://eml.ecoinformatics.org/eml-2.2.0\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:stmml=\"http://www.xml-cml.org/schema/stmml-1.2\" packageId=\"CAHA_Fish_metadata\" xsi:schemaLocation=\"https://eml.ecoinformatics.org/eml-2.2.0/eml.xsd https://eml.ecoinformatics.org/eml-2.2.0/eml.xsd\" system=\"unknown\">\n  <dataset>\n    <alternateIdentifier>doi: https://doi.org/10.57830/2295255</alternateIdentifier>\n    <title>Fish Inventory at Cape Hatteras National Seashore in 2003 - Open Format Dataset</title>\n    <creator>\n      <individualName>\n        <givenName>Issac</givenName>\n        <givenName>A</givenName>\n        <surName>Quevedo</surName>\n      </individualName>\n      <organizationName>NPS</organizationName>\n      <electronicMailAddress>issac_quevedo@partner.nps.gov</electronicMailAddress>\n      <userId directory=\"https://orcid.org\">https://orcid.org/0000-0003-0129-981X</userId>\n    </creator>\n    <metadataProvider>\n      <organizationName>SECN</organizationName>\n    </metadataProvider>\n    <metadataProvider>\n      <organizationName>IMD</organizationName>\n    </metadataProvider>\n    <pubDate>2023-04-12</pubDate>\n    <language>eng</language>\n    <abstract>\n      <para>\"The Southeast Coast Network is comprised of 20 parks within the states of North and South Carolina, Georgia and Florida, all of which are responsible for a large percentage of the fish diversity in the United States. Collectively, these parks would be expected to harbor a high diversity of fishes due to the wide range of habitats represented. At the time of the present study (2001-2005), many basic species inventories for fishes were lacking for many of the parks in the network. The purpose of the study was to sample fishes in 12 parks to supplement existing data or to provide preliminary records of fishes where no records existed. From these data an expected list of fishes for all parks was generated. In 2023, the data was then processed for dissemination by the Inventory and Monitoring Division (IMD), complying with Executive Order 13642, Making Open and Machine Readable the New Default for Government Information (GPO 2013). Processed tabular datasets have been created using the data provided from the parks, following Darwin Core naming standards and introducing data quality flagging where data was missing or unclear.\"&amp;#13;\n</para>\n    </abstract>\n    <keywordSet>\n      <keyword>fish</keyword>\n      <keyword>inventory</keyword>\n      <keyword>species</keyword>\n      <keyword>taxonomy</keyword>\n      <keyword>survey</keyword>\n      <keyword>biodiversity</keyword>\n      <keyword>monitoring</keyword>\n      <keywordThesaurus>LTER Controlled Vocabulary</keywordThesaurus>\n    </keywordSet>\n    <keywordSet>\n      <keyword>observations</keyword>\n      <keyword>npspecies</keyword>\n      <keyword>coast</keyword>\n    </keywordSet>\n    <intellectualRights>This product is released to the \"public domain\" under U.S. Government Works No Rights Reserved (see: http://www.usa.gov/publicdomain/label/1.0/).</intellectualRights>\n    <licensed>\n      <licenseName>Public Domain</licenseName>\n    </licensed>\n    <coverage>\n      <geographicCoverage>\n        <geographicDescription>NPS Content Unit Link: CAHA</geographicDescription>\n        <boundingCoordinates>\n          <westBoundingCoordinate>-75.4601</westBoundingCoordinate>\n          <eastBoundingCoordinate>-76.0167</eastBoundingCoordinate>\n          <northBoundingCoordinate>35.9065</northBoundingCoordinate>\n          <southBoundingCoordinate>35.0651</southBoundingCoordinate>\n        </boundingCoordinates>\n      </geographicCoverage>\n      <geographicCoverage>\n        <geographicDescription>1</geographicDescription>\n        <boundingCoordinates>\n          <westBoundingCoordinate>-75.59375</westBoundingCoordinate>\n          <eastBoundingCoordinate>-75.59375<